description:
here comes the grrrl* compilation numero 6 called &quot;cats against catcalling!&quot;.

we are happy, glad, surprised and proud how many bands submitted to this one!
95 bands, or are we counting wrong? no... it is 95 BANDS and nearly 5 hours! unbelievable!!!

as always we don't have a running order here, just this famous thing called &quot;alphabet&quot; is putting some kind of order in this. make your own!
we haven't changed the files in loudness, quality or length. we think it's the artists decisicion, how and what quality they want to give to this.  and we are glad it worked out so good!!! 
